import React from 'react';
import "./Header.css";
import PersonIcon from "@material-ui/icons/Person";

function Header() {
  return (
    
    <div className="header">
        <h2>This is a header for Person</h2>
        <PersonIcon fontSize="large" className="header__icon"/>
    </div>
    
  )
}

export default Header
